CREATE TABLE cars (
id INT PRIMARY KEY,
make VARCHAR(255),
model VARCHAR(255),
year INT,
price DECIMAL(10,2),
quantity INT
);

CREATE TABLE customers (
id INT PRIMARY KEY,
first_name VARCHAR(255),
last_name VARCHAR(255),
address VARCHAR(255),
phone VARCHAR(255)
);

CREATE TABLE sales (
id INT PRIMARY KEY,
customer_id INT,
car_id INT,
price DECIMAL(10,2),
FOREIGN KEY (customer_id) REFERENCES customers(id),
FOREIGN KEY (car_id) REFERENCES cars(id)
);




